import styled from "styled-components";

const Container = styled.button`
  display:flex;
  width: auto;
  min-width: 130px;
  border-radius: 10px;
  border : 2px solid #799FC4;
  height: 30px;
  text-align: center;
  background-color : white;
  
`;

export default function ButtonCategory() {
  return (
    <>
    <Container>

    </Container>
    </>
  )
}
